const ImageGridListStyle = {
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		justifyContent: 'space-around',
		overflow: 'hidden',
		backgroundColor: "#fff",
	},
	gridList: {
		height: "auto !important",
	},
};

export default ImageGridListStyle;
